import React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { Icon } from "react-native-elements";
import VinilosStack from "./VinilosStack";
import CdsStack from "./CdsStack";
import FavoritesStack from "./FavoritesStack";
import TopStack from "./TopStack";
import SearchStack from "./SearchStack";
import AccountStack from "./AccountStack";

const Tab = createBottomTabNavigator();

export default function Navigation() {
  return (
    <NavigationContainer>
      <Tab.Navigator
        initialRouteName="vinilos"
        tabBarOptions={{
          inactiveTintColor: "#908784fa",
          activeTintColor: "#ea4d14fa",
        }}
        screenOptions={({ route }) => ({
          tabBarIcon: ({ color }) => screenOptions(route, color),
        })}
      >
        <Tab.Screen
          name="vinilos"
          component={VinilosStack}
          options={{ title: "Vinilos" }}
        />
        <Tab.Screen
          name="cds"
          component={CdsStack}
          options={{ title: "Compactos" }}
        />
        <Tab.Screen
          name="favorites"
          component={FavoritesStack}
          options={{ title: "Favoritos" }}
        />
        <Tab.Screen
          name="top-vinilos-cds"
          component={TopStack}
          options={{ title: "Top 5" }}
        />
        <Tab.Screen
          name="search"
          component={SearchStack}
          options={{ title: "Buscar" }}
        />
        <Tab.Screen
          name="account"
          component={AccountStack}
          options={{ title: "Cuenta" }}
        />
      </Tab.Navigator>
    </NavigationContainer>
  );
}

function screenOptions(route, color) {
  let iconName;

  switch (route.name) {
    case "vinilos":
      iconName = "compass-outline";
      break;
    case "cds":
      iconName = "disc";
      break;
    default:
      break;
  }
  return (
    <Icon type="material-community" name={iconName} size={22} color={color} />
  );
}
